    )
}

function Yet() {
    return(
        <li className='yet'/>
    )
}

export default function Bookshelf() {
    return(
        <div>
            <div className='menu'>
                <p className='helloWorld'>내 서재</p>

                <ul className='bookStorage1'>
                        <Books src='img/Mainbook.png' bookName='theHen'/>
                        <Books src='img/love.png' bookName='love'/>
                        <Books src='img/tomato.png' bookName='tomato'/>     
                        <Books src='img/tomato.png' bookName='tomato'/> 
                </ul>

                <ul className='bookStorage2'>
                        <Yet />
